import { FormControl, FormLabel } from "@chakra-ui/react";
import React from "react";
import { VStack } from "@chakra-ui/react";
const Signup = () => {
  return (
    <VStack spacing="5px">
      <FormControl>
        <FormLabel></FormLabel>
      </FormControl>
    </VStack>
  );
};

export default Signup;
